import "../styles/SignUpComp.css";
import { useForm } from "react-hook-form";

const SignUpComp = () => {
  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm();

  console.log({ errors });
  const onSubmit = (data) => {
    console.log(data);
  };

  return (
    <div className="container-company">
      <form className="form">
        <h2>Dados da Empresa</h2>
        <div className="container-form">
          <label>
            <span>Nome:</span>
            <input
              className={errors?.name && "input-error"}
              type="text"
              placeholder="Nome"
              {...register("name", { required: true })}
            />
            {errors?.name?.type === "required" && (
              <p className="error-message">O nome é obrigatório.</p>
            )}
          </label>
          <label>
            <span>Nome Fantasia</span>
            <input
              className={errors?.name && "input-error"}
              type="text"
              placeholder="Nome"
              {...register("name", { required: true })}
            />
            {errors?.name?.type === "required" && (
              <p className="error-message">O nome é obrigatório.</p>
            )}
          </label>
          <label>
            <span>Data de abertura:</span>
            <input
              className={errors?.date && "input-error"}
              type="date"
              placeholder="Email"
              {...register("email", { required: true })}
            />
            {errors?.email?.type === "required" && (
              <p className="error-message">O email é obrigatório.</p>
            )}
          </label>
          <label>
            <span>CNPJ:</span>
            <input
              className={errors?.cnpj && "input-error"}
              type="text"
              placeholder="CNPJ"
              {...register("cnpj", { required: true })}
            />
            {errors?.cpf?.type === "required" && (
              <p className="error-message">O cpf é obrigatório.</p>
            )}
          </label>
          <label>
            <span>Atividade Econômica:</span>
            <input
              className={errors?.atividadeeco && "input-error"}
              type="text"
              placeholder="Atividade Econômica"
              {...register("atividadeeco", { required: true })}
            />
            {errors?.AtividadeEco?.type === "required" && (
              <p className="error-message">O telefone é obrigatório.</p>
            )}
          </label>
          <label>
            <span>Status:</span>
            <select {...register("status")}>
              <option value="2">Pendente</option>
            </select>
          </label>
          <div className="checkbox">
            <input
              type="checkbox"
              name="privacy-policy"
              {...register("privacyTerms", { required: true })}
              className={errors?.privacy && "input-error"}
            />
            <label>Concordo com os termos de privacidade.</label>
            {errors?.privacyTerms?.type === "required" && (
              <p className="error-message-privacy">
                É necessario concordar com os termos para se cadastrar.
              </p>
            )}
          </div>
        </div>
        <div className="submit-input">
          <button onClick={handleSubmit(onSubmit)}>Enviar</button>
        </div>
      </form>
    </div>
  );
};

export default SignUpComp;
